import React from 'react';
import { Link } from 'react-router-dom';

const Followers = ({ followerList }) => {
    return (
        <div>
            <h3>Followers</h3>
            <ul>
                {followerList.map(user => (
                    <li key={user.userID}>
                        <Link to={`/viewprofile/${user.userID}`}>{user.name}</Link>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Followers;
